import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs'
import promo from './telas/Home/componentes/promo.js'
import index from 'C:/Users/Rodrigo/Desktop/OFTRANCE/app-of-trance/src/telas/Home/index.js'

const Tab = createBottomTabNavigator();

export default function Routes() {
    return(
        <Tab.Navigator
        screenOptions={{
            tabBarActiveBackgroundColor: '#121212',
            tabBarInactiveBackgroundColor: '#121212'
          }}>
            <Tab.Screen name='HOME' component={index} options={{headerShown: false}} />
            <Tab.Screen name='PRODUTOS' component={promo} options={{headerShown: false}} />
        </Tab.Navigator>
    )
}
